import React from 'react'

const Cafe = (props) => {
    const {cafes} = props
    return(
        <div>
            {
                cafes.map(cafe =>{
                    const {cafeName,photoURL} = cafe
                    return (
                    <div>
                        <h1>{cafeName}</h1>
                        <img src = {photoURL}></img>
                    </div>
                    )
                })
            }
        </div>
    )
}

export default Cafe
